sub
fieldFormat
{
    padFields(4);

    my $basis   = $fields[0];
    my @names = split(/\|/, $fields[1]);
    my @roles   = split(/\|/, $fields[2]);
    my $dept   = $fields[3];

    my $retstr ="";

    if ($basis =~ /Observation/i)
    {
        for my $i (0 .. $#names)
        {
            if (defined($roles[$i]) and ($roles[$i] =~ /Observer/i))
            {
                $retstr .= "$names[$i]|";
            }
        }
        $retstr =~ s/\|$//;
        return("$retstr");
    }

    if ($dept =~ /Botany|Action/i)
    {
        for my $i (0 .. $#names)
        {
            if (defined($roles[$i]) and ($roles[$i] =~ /Primary Collector/i))
            {
                $retstr .= "$names[$i]|";
             }
        }                                                                               
        $retstr =~ s/\|$//;
        return("$retstr");
    }

    # return all names
    return("$fields[1]");
}


sub
padFields
{
    my $noArgs = shift;                                                         
    for my $i ($#fields + 1 .. $noArgs - 1)
    {
        $fields[$i] = "";
    }
}

sub
fieldFormat
{
    if (defined($fields[0]))
    {
        if ($fields[0] =~ /Botany/i)
       {
            return("F");
        }
        else
        {
             return("FMNH")
        }
    }
    return "";
}

