sub
fieldFormat
{
    my @rank = ();
    my @subspecies = ();
    my @name = ();
    my @other = ();
    my $taxonrank = "";
    my $value = "";
    my $i;
    my $max = @fields;

    if ($max > 0)
    {
        @rank = split(/\|/, $fields[0]);
    }
    if ($max > 1)
    {
        @subspecies = split(/\|/, $fields[1]);
    }
    if ($max > 2)
    {
        @name = split(/\|/, $fields[2]);
    }
    if ($max > 3)
    {
        @other = split(/\|/, $fields[3]);
    }
    if ($max > 4)
    {
        $taxonrank = $fields[4];
    }

    if (! @rank && ! @subspecies)
    {
        return("");
    }
    if (! @rank && @subspecies)
    {
        if (@subspecies == 1)
        {
                $value = $fields[1];
        }
        else
        {
            for ($i = 0; $i < @subspecies; $i++)
            {
                $value .= ($i ? "|" : "");
                $value .= $subspecies[$i] . "-" . $name[$i];
            }
        }
        return($value);
    }
    if (@rank > 0 && ! @subspecies && $taxonrank ne "")
    {
        for ($i = 0; $i < @rank; $i++)
        {
            if ($rank[$i] =~ /^$taxonrank$/i)
            {
                return($other[$i]);
            }
        }
    }
    return("");
}

