sub
fieldFormat
{
    my @types = split(/\|/, $fields[0]);
    my @seq = split(/\|/, $fields[1]);
    my $dept = $fields[2];
   my $pm = "";

    if ($dept =~ /Zoology/i)
    {
        my $cseq = 1;
        for (my $i = 0; $i < @types; $i++)
        {
            if ($seq[$i] == $cseq)
            {
                $pm .= ($pm ne "" ? ">" : "");
            }
            else
            {
                $cseq = $seq[$i];
                $pm .= "|";
            }
            $pm .= $types[$i];
        }
    }
    else
    {
        $pm = $fields[3];
    }
    return($pm);
}

