sub
fieldFormat
{
    my $depth = "";
    #
    # Check the orig from and to fields to see the measure to use
    #
    if (($fields[6] eq "" && $fields[7] eq "") || $fields[6] != $fields[7])
    {
        return($depth);
    }
    my $index = 0;
    if ($fields[6] == 1 && $fields[7] == 1)
    {
        $index = 2;
    }
    elsif ($fields[6] == 2 && $fields[7] == 2)
    {
        $index = 4;
    }
    if ($fields[$index] ne "")
    {
        $depth .= $fields[$index]
    }
    if ($fields[$index + 1] ne "")
    {
        $depth .= ($depth ne "" ? "-" : "") . $fields[$index + 1]
    }
    if ($depth ne "")
    {
        $depth .= ($index ? ($index == 2 ? "(ft)" : "(fath)") : "(m)");
    }
    return($depth);
}

sub
fieldFormat
{
    my $elevation = "";
    #
    # Check the orig from and to fields to see if feet is being used
    #
    if (($fields[4] eq "" && $fields[5] eq "") || $fields[4] != $fields[5])
    {
        return($elevation);
    }
    my $index = ($fields[4] != 1 || $fields[5] != 1 ? 0 : 2);
    if ($fields[$index] ne "")
    {
        $elevation .= $fields[$index]
    }
    if ($fields[$index + 1] ne "")
    {
        $elevation .= ($elevation ne "" ? "-" : "") . $fields[$index + 1]
    }
    if ($elevation ne "")
    {
        $elevation .= ($index ? "(ft)" : "(m)");
    }
    return($elevation);
}

