sub
fieldFormat
{
    padFields(4);

    my $dept        = $fields[0];
    my $eventCode   = $fields[1];
    my @otherNo     = split(/\|/, $fields[2]);
    my @noSource    = split(/\|/, $fields[3]);

    if ($dept =~ /^zoology$/i)
    {
        return($eventCode);
    }
    for my $i (0 .. $#noSource)
    {
        if ($noSource[$i] =~ /^Field Number$/i)
        {
           return($otherNo[$i]);
        }
    }
    return("");
}

