}

sub
fieldFormat
{
    my @numbers = split(/\|/, $fields[0]);
    my @source = split(/\|/, $fields[1]);
    my $value = "";

    for (my $i = 0; $i < @numbers; $i++)
    {
        $value .= ($i ? "|" : "");
        $value .= $numbers[$i];
        if ($source[$i] ne "")
        {
                $value .=  " [" . $source[$i] . "]";
        }
    }
    return($value);
}

sub
fieldFormat
{
    if ($fields[0] !~ /^\d\d\d\d-(\d\d)/)
    {
        return("");
    }
    my $month = $1;
    return("January") if ($month == 1);
    return("February") if ($month == 2);
    return("March") if ($month == 3);
    return("April") if ($month == 4);
    return("May") if ($month == 5);
    return("June") if ($month == 6);
    return("July") if ($month == 7);
    return("August") if ($month == 8);
    return("September") if ($month == 9);
    return("October") if ($month == 10);
    return("November") if ($month == 11);
    return("December") if ($month == 12);
    return("");
}

sub
is_leap_year
{
    my $year = shift;

    return(($year % 400 == 0) || (($year % 4 == 0) && ($year % 100 != 100)));
}

sub
month_len
{
    my $year = shift;
    my $month = shift;

    if (is_leap_year($year) && $month == 2)
    {
        return(29);
    }
    my @days = (0, 31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31);
    return($days[$month]);
}

sub
year_day_from_date
{
    my $year = shift;
    my $month = shift;
    my $day = shift;

    my $days = 0;
    for (my $i = 1; $i < $month; $i++)
    {
        $days += month_len($year, $i);
    }
    $days += $day;
    return($days);
}

sub
fieldFormat
{
    if ($fields[0] !~ /(\d\d\d\d)-(\d\d)-(\d\d)/)
    {
        return("");
    }
    return(year_day_from_date($1, $2, $3));
}

sub
fieldFormat
{
    if ($fields[0] =~ /Anthropology/i)
    {
        return($fields[2]);
    }
    if ($fields[1] =~ /Amphibians and Reptiles/i)
    {
        if ($fields[3] ne "")
        {
            if ($fields[4] eq "")
            {
                return("Precise locality withheld");
            }
            else
            {
                return("$fields[4]|Precise locality withheld");
            }
        }
    }
    return($fields[3]);
}

sub
fieldFormat
{
    my @types= ();
    my @organs = ();
    my @values = ();
    my $tissue = "";
    my $max = @fields;

    if ($max > 0)
    {
        @types = split(/\|/, $fields[0]);
    }
    if ($max > 1)
    {
        @organs = split(/\|/, $fields[1]);
    }
    if ($max > 2)
    {
        $tissue = ($fields[2] =~ /Yes/i);
    }
    $max = @types;
    if (@organs > $max)
    {
        $max = @organs;
    }
    for (my $i = 0; $i < $max; $i++)
    {
        $values[$i] = $types[$i];
        if ($organs[$i] ne "")
        {
            $values[$i] .= ($values[$i] ne "" ? ", " : "") . $organs[$i];
        }
        if ($tissue)
        {
            $values[$i] .= " - tissue";
        }
    }
    return(join("|", @values));
}

