sub
fieldFormat
{
   padFields(7);

   my $id = $fields[0];
   my $number = $fields[1];
   my $rights = $fields[2];
   my $department = $fields[3];
   my $catalog = $fields[4];
   my $time = $fields[5];
   my $subset = $fields[6];

  my $ref = getRef($department, $catalog, $subset);
  if ($id eq "" && $number eq "" && $rights eq "" && $ref eq "" && $time eq "")
  {
    return "";
  }
  return "$id $number $rights $ref (lastmodified $time)";
}

sub
padFields
{
    my $noArgs = shift;                                                         
    for my $i ($#fields + 1 .. $noArgs - 1)
    {
        $fields[$i] = "";
    }
} 

sub
getRef
{
	my $department = shift;
	my $catalog = shift;
	my $subset = shift;

	if ($department =~ /Zoology/i)
	{
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_herps" if ($catalog =~ /Amphibians and Reptiles/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fm_birds_eggs" if ($catalog =~ /Birds Eggs/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fm_birds" if ($catalog =~ /Birds/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_fishes" if ($catalog =~ /Fishes/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_insects" if ($catalog =~ /Insects/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_invertebrates" if ($catalog =~ /Invertebrate Zoology/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_mammals" if ($catalog =~ /Mammals/i);
		return "";
	}
	if ($department =~ /Botany/i)
	{
		$catalog = $subset;
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_seedplants" if ($catalog =~ /Seed Plants/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_brypphyte" if ($catalog =~ /Bryophytes/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_fungi" if ($catalog =~ /Fungi/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_lichens" if ($catalog =~ /Lichens/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh_pteridophytes" if ($catalog =~ /Pteridophytes/i);
		return "";
	}
	if ($department =~ /Geology/i)
	{
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh-fossil-invertebrates" if ($catalog =~ /Fossil Invertebrates/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh-paleobotany" if ($catalog =~ /Paleobotany/i);
		return "https://fmipt.fieldmuseum.org/ipt/resource?r=fmnh-fossil-verts" if ($catalog =~ /Fossil Birds/i || $catalog =~ /Fossil Fishes/i || $catalog =~ /Fossil Birds/i || $catalog =~ /Fossil Mammals/i || $catalog =~ /Fossil Synapsids/i || $catalog =~ /Fossil Vertebrates/i);
		return "";
	}
	return "";
}

sub
fieldFormat
{
    if ($fields[0] !~ /Anthropology/i && $fields[0] !~ /Exhibitions/i)
    {
        return("CC0 1.0 Universal"); # Rights irn 751 RigOtherNumber
    }
    return "";
}

sub
is_leap_year
{
    my $year = shift;

    return(($year % 400 == 0) || (($year % 4 == 0) && ($year % 100 != 100)));
}

sub
month_len
{
    my $year = shift;
    my $month = shift;

    if (is_leap_year($year) && $month == 2)
    {
        return(29);
    }
    my @days = (0, 31, 28, 31, 30, 31, 30, 31, 31, 30, 31, 30, 31);
    return($days[$month]);
}

sub
year_day_from_date
{
    my $year = shift;
    my $month = shift;
    my $day = shift;

    my $days = 0;
    for (my $i = 1; $i < $month; $i++)
    {
        $days += month_len($year, $i);
    }
    $days += $day;
    return($days);
}

sub
fieldFormat
{
    if ($fields[0] !~ /(\d\d\d\d)-(\d\d)-(\d\d)/)
    {
        return("");
    }
    return(year_day_from_date($1, $2, $3));
}
